export default function Home({ user }) {
  if (!user) {
    return (
      <div className="notice">
        कृपया पहले लॉगिन करें (Please login first)
      </div>
    );
  }

  return (
    <div>
      <h2>Welcome, {user.name}</h2>
      <p>Your role: {user.role}</p>
      {/* your rest of Home page */}
    </div>
  );
}
